import React from "react";
import "./Operadores.css";

function Operadores() {
    return (
        <React.Fragment>
            <div>
                <div><button>+</button></div>
                <div><button>-</button></div>
                <div><button>x</button></div>
                <div><button>/</button></div>
                <div><button>=</button></div>
            </div>
        </React.Fragment>
    );
}

export { Operadores };
